import { Paper, Typography, Box } from '@material-ui/core'
import { useState } from 'react'

const Card = ({ title, children, paper, ...props }) => {
    // const [paper, setPaper] = useState(false)

    if (paper) {
        return (
            <Paper>
                <Box {...props}>
    
                    { title != undefined && 
                    <Typography variant="h3">
                        {title}
                    </Typography> }
    
                    {children}
    
                </Box>
            </Paper>
        )
    }

    return (
        <Box {...props}>

            { title != undefined && 
            <Typography variant="h3">
                {title}
            </Typography> }

            {children}

        </Box>
    )
}

export default Card
